// methods: GET, POST DELETE, PUT
// status: 200, 500, 404




import React from "react";

function app() {
    fetch('https://jsonplaceholder.typicode.com/posts', {
        method: 'POST',   
    }
    ).then((data) =>{
        if(data.status === 200) {
            return data.json();
        }
        else {
            console.error('Its not ok!')
        }
        console.log(data)
        }).then((info => {
            console.log(info)
        }))
    }

export default app
